import React from 'react';
import { Typography, Box, IconButton } from '@mui/material';
import { Facebook, Instagram, Twitter, LinkedIn } from '@mui/icons-material';

const Contact = () => {
  return (
    <Box
      sx={{
        padding: 4,
        textAlign: 'center',
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        justifyContent: 'center',
        minHeight: 'calc(100vh - 64px)', // Ajusta para cubrir el área debajo del navbar
        marginTop: '64px', // Deja espacio para que no se solape con el navbar
      }}
    >
      <Typography variant="h4" gutterBottom>
        Contacto
      </Typography>
      <Typography variant="body1" gutterBottom>
        ¡Conéctate con nosotros a través de nuestras redes sociales!
      </Typography>
      <Box sx={{ display: 'flex', justifyContent: 'center' }}>
        <IconButton href="https://facebook.com" target="_blank" color="primary">
          <Facebook />
        </IconButton>
        <IconButton href="https://instagram.com" target="_blank" color="secondary">
          <Instagram />
        </IconButton>
        <IconButton href="https://twitter.com" target="_blank" color="primary">
          <Twitter />
        </IconButton>
        <IconButton href="https://linkedin.com" target="_blank" color="secondary">
          <LinkedIn />
        </IconButton>
      </Box>
    </Box>
  );
};

export default Contact;
